import classes from './Content.css';

const Content = () => {
    return(

    <div className='content'>
        
        
       
        <div className='item'>MY POST</div>
        <div>New post</div>
        <div>
          <div>POST1</div>
          <div>POST2</div>
          <div>POST3</div>
          </div>
      </div>
    )
}

export default Content;
